import React from "react";

function Portfolio(props) {
  // const currentCategory = props

  return (
    <section>
      <h2>My Projects</h2>
      <div className="flex-row">
        <a
          href="https://afternoon-harbor-62644.herokuapp.com/"
          target="_blank"
          rel="noreferrer"
        >
          <img className="link-img" alt="" />
        </a>
       </div>
       </section> 
  );
};

export default Portfolio;
